import logo from "./logo.png";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} alt="logo" className="img-fluid" />
        <p className="text-center">hej</p>
      </header>
    </div>
  );
}

export default App;
